import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom'

const ShtoKategori = () => {

    const[kategori,setKategori]=useState({
        id:'',
        name:'',
        description:''
    })

    const handleSubmit = (event) => {
        event.preventDefault();
        const formData = new FormData();  
        formData.append("id", kategori.id);
        formData.append("name", kategori.name);
        formData.append("description", kategori.description);
        axios.post('http://localhost:8081/kategorite/insertKategori', formData)
          .then(res => {
            navigate('/kategorite')
          })
          .catch(err => console.log(err))
      }

    const navigate=useNavigate();

  return (
    <div className='d-flex flex-column align-items-center pt-4'>
          <h2>Krijo Kategori</h2>
          <form class="row g-3 w-50" onSubmit={handleSubmit}>
            <div class="col-12">
              <label for="inputID" class="form-label">Id</label>
              <input type="number" class="form-control" id="inputId" placeholder='Enter ID' autoComplete='off'
                onChange={e => setKategori({ ...kategori, id: e.target.value })} />
            </div>
            <div class="col-12">
              <label for="inputName" class="form-label">Name</label>
              <textarea class="form-control" id="inputName" rows="3" placeholder='Enter Name'
                onChange={e => setKategori({ ...kategori, name: e.target.value })}></textarea>
            </div>
            <div class="col-12">
              <label for="inputDescription" class="form-label">Description</label>
              <textarea class="form-control" id="inputDescription" rows="3" placeholder='Enter Description'
                onChange={e => setKategori({ ...kategori, description: e.target.value })}></textarea>
            </div>
            <div class="col-12">
              <button type="submit" class="btn btn-primary">Create</button>
            </div>
          </form>
        </div>
  )
}

export default ShtoKategori
